{-# LANGUAGE PatternSynonyms #-}

module HACKY (module HACKY) where

import qualified Codec.CBOR.Decoding as CBOR
import qualified Codec.CBOR.Encoding as CBOR
import qualified Codec.CBOR.Read as CBOR
import qualified Data.ByteString.Lazy as BL
import qualified Data.ByteString.Lazy.Base64 as BL
import           Data.List (unfoldr)
import qualified Data.Map as Map
import           Data.String (fromString)

import           Cardano.Chain.Slotting (EpochSlots (..))
import           Cardano.Ledger.Crypto (StandardCrypto)

import           Ouroboros.Consensus.Block.Abstract (CodecConfig, blockPoint)
import qualified Ouroboros.Consensus.Storage.Serialisation as Disk

import qualified Ouroboros.Consensus.Byron.Ledger.Config as Byron

import qualified Ouroboros.Consensus.Shelley.Ledger.Config as Shelley

import           Ouroboros.Consensus.Cardano.Block (CardanoBlock, pattern CardanoCodecConfig)
import           Ouroboros.Consensus.Cardano ()

type B = CardanoBlock StandardCrypto

codecCfg :: CodecConfig B
codecCfg =
    CardanoCodecConfig
      (Byron.ByronCodecConfig $ EpochSlots $ 10 * 2160)
      Shelley.ShelleyCodecConfig
      Shelley.ShelleyCodecConfig
      Shelley.ShelleyCodecConfig
      Shelley.ShelleyCodecConfig

next :: BL.ByteString -> Maybe ((BL.ByteString, B), BL.ByteString)
next bytes = case CBOR.deserialiseFromBytes (Disk.decodeDisk codecCfg) bytes of
    Left _err           -> Nothing
    Right (bytes', fun) ->
      let n     = BL.length bytes - BL.length bytes'
          slice = BL.take n bytes
      in Just ((slice, fun slice), bytes')

deserialiseB :: BL.ByteString -> B
deserialiseB bytes =
  case next bytes of
    Just ((_, b), rest)
      | BL.null rest -> b
      | otherwise    -> error "HACKY: trailing data"
    Nothing          -> error "HACKY: can't decode block"

decodeB :: BL.ByteString -> CBOR.Decoder s B
decodeB bytes = fmap ($ bytes) (Disk.decodeDisk codecCfg)

encodeB :: B -> CBOR.Encoding
encodeB = Disk.encodeDisk codecCfg

-- | Prints the smallest and largest blocks in the given @.chunk@ file
processChunkFile :: FilePath -> IO ()
processChunkFile path = do
  bytes <- BL.readFile path
  let m = Map.fromList [
            (BL.length slice, (blockPoint blk, BL.encodeBase64 slice))
            | (slice, blk) <- unfoldr next bytes
            ]
  print $ Map.findMin m
  print $ Map.findMax m

